// lib
import React from "react";
import { createUseStyles } from "react-jss";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import { useState, useEffect } from "react";

// Component
// import Home from "./components/home/Home";

// =================================================================
const useStyles = createUseStyles({
  sign: {
    minHeight: "100vh",
  },
  sign__title: {
    fontSize: "5rem",
    marginBottom: "5rem",
  },
  sign__separate: {
    marginBottom: "2rem",
    fontSize: "1.5rem",
    color: "var(--text-color)",
  },
  sign__link: {
    display: "flex",
    alignItems: "center",
    gap: "0.5rem",
    marginTop: "2rem",
    color: "var(--text-color)",
    fontSize: "1.6rem",
  },
  sign__link__light: {
    color: "var(--text-color-light) !important",
  },
  sign__input: {
    fontSize: "1.6rem",
    marginBottom: "2rem",
  },
});

export default function sign() {
  const classes = useStyles();

  return (
    <div className={classes.sign}>
      <div className="content">
        <h1 className={classes.sign__title}>Sign In.</h1>

        <div className="buttons w-100">
          <button className="button btn--border btn--full-width btn--flex">
            <div className="button__icon">
              <ion-icon name="logo-google"></ion-icon>
            </div>
            <div className="button__text">Continue with Google</div>
          </button>
          <button className="button btn--border btn--full-width btn--flex">
            <div className="button__icon">
              <ion-icon name="logo-facebook"></ion-icon>
            </div>
            <div className="button__text">Continue with Facebook</div>
          </button>
        </div>

        <div className={classes.sign__separate}>or</div>

        <div className="inputs w-100">
          <input
            type="email"
            placeholder="Email"
            className={
              classes.sign__input + " input--border btn--full-width"
            }
          />
          <input
            type="password"
            placeholder="Password"
            className={
              classes.sign__input + " input--border btn--full-width"
            }
          />
        </div>

        <button className="button btn--bg-pink btn--bb-pink btn--none-border w-100">
          <span className="button__text">Sign Up</span>
        </button>

        <div className={classes.sign__link}>
          <span>Don't have an account?</span>
          <a href="sdd" className={classes.sign__link__light}>
            Sign up
          </a>
        </div>

        <a
          href="#"
          className={classes.sign__link + " " + classes.sign__link__light}
        >
          Forgot password?
        </a>

        <a href="#" className={classes.sign__link}>
          <ion-icon name="arrow-back-outline"></ion-icon>
          <div>Back to Home</div>
        </a>
      </div>
    </div>
  );
}
